import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
// USERS is an array of objects, which we need to convert into JSX (javascript components)
import { users } from "../data";


const employees = users.map((users) =>
    <div class="table-wrapper">
        <table class="table-responsive card-list-table">
            <thead>
                <tr>
                    <th>ID:</th>
                    <th>NAME:</th>
                    <th>DEPARTMENT:</th>
                    <th>ROLE:</th>
                    <th>E-MAIL:</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td data-title="Column #1">{users.id}</td>
                    <td data-title="Column #2">{users.name}</td>
                    <td data-title="Column #3">{users.department}</td>
                    <td data-title="Column #4">{users.role}</td>
                    <td data-title="Column #5">{users.email}</td>
                </tr>
            </tbody>
        </table>
    </div>
  );

function Table() {

    return (
        <card>
            {employees}
        </card>
    );
}

